import { Component } from '@angular/core';
import { NgForm } from '@angular/forms';
import { Sddiagnostic } from 'src/app/models/Sddiagnostic';
import { SddiagnosticService } from 'src/app/services/sddiagnostic.service';

@Component({
selector: 'app-sddiagnostic',
templateUrl: './sddiagnostic.component.html',
styleUrls: ['./sddiagnostic.component.css']
})
export class SddiagnosticComponent {
sddiagnostic: Sddiagnostic = new Sddiagnostic();

constructor(private sddiagnosticService: SddiagnosticService) {}

onSubmit(form: NgForm) {
  if (form.valid) {
    this.sddiagnosticService.createSddiagnostic(this.sddiagnostic).subscribe(
      response => {
        console.log('Form submitted successfully', response);
      },
      error => {
        console.error('Error submitting form', error);
      }
    );
  }
}

toggleField(field: string) {
  this.sddiagnostic[field] = !this.sddiagnostic[field];
}
}
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Sddiagnostic Form</title>
  <style>
    /* Form Container */
    .form-container {
      max-width: 1200px;
      margin: 0 auto;
      padding: 20px;
      background-color: #f0f0f0;
    }

    /* Form Style */
    .form-container form {
      background-color: #f9f9f9;
      padding: 20px;
      border-radius: 10px;
      box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.1);
    }

    /* Form Input Fields */
    .form-container form div {
      margin-bottom: 15px;
    }

    .form-container form label {
      display: block;
      margin-bottom: 5px;
      font-weight: bold;
      text-transform: capitalize; /* Convert label text to title case */
    }

    .form-container form input,
    .form-container form select {
      width: 100%;
      padding: 10px;
      margin: 8px 0;
      border: 1px solid #ccc;
      border-radius: 5px;
    }

    .form-container form .submit-row {
      text-align: center; /* Center content horizontally */
      margin-top: 20px;
    }

    .form-container form input[type="submit"] {
      background-color: #000 !important;
      color: #fff !important;
      padding: 12px 20px;
      border: none;
      border-radius: 5px;
      cursor: pointer;
      transition: background-color 0.3s ease;
    }

    /* Form Submit Button Hover Effect */
    .form-container form input[type="submit"]:hover {
      background-color: #000;
      color: #fff;
    }

    /* Custom Select Style */
    .form-container form select {
      width: 100%;
      padding: 10px;
      margin: 8px 0;
      border: 1px solid #ccc;
      border-radius: 5px;
      background-color: #fff;
      font-size: 16px;
      cursor: pointer;
      appearance: none;
      -webkit-appearance: none;
      -moz-appearance: none;
      background-image: url('data:image/svg+xml;utf8,<svg fill="currentColor" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16"><path fill-rule="evenodd" d="M7.68 11.895a.75.75 0 0 1-1.06-1.06L7.94 9.44V5.75a.75.75 0 0 1 1.5 0v3.69l1.32 1.33a.75.75 0 0 1-1.06 1.06L8 10.56l-.32.32z"/></svg>');
      background-repeat: no-repeat;
      background-position: right 10px top 50%, 0 0;
      background-size: 16px auto, 100%;
    }

    /* Three Lines Per Row Layout */
    .form-container .row {
      display: flex;
      justify-content: space-between;
      margin-bottom: 15px;
    }

    .form-container .row .column {
      width: 31%;
    }

    .form-container .row .column.two-cols {
      width: 48%;
    }
  </style>
</head>
<body>
  <div class="form-container">
    <form (ngSubmit)="onSubmit()" action="/submit-sddiagnostic">

      <!-- First Row -->
      <div class="row">
        <div class="column">
          <div>
            <label for="patientId">Patient ID:</label>
            <input type="number" id="patientId" [(ngModel)]="sddiagnostic.PatientId" name="patientId" required>
          </div>
        </div>
        <div class="column">
          <div>
            <label for="age">Age:</label>
            <input type="number" id="age" [(ngModel)]="sddiagnostic.Age" name="age" required>
          </div>
        </div>
        <div class="column">
          <div>
            <label for="poids">Poids:</label>
            <input type="number" id="poids" [(ngModel)]="sddiagnostic.Poids" name="poids">
          </div>
        </div>
      </div>

      <!-- Second Row -->
      <div class="row">
        <div class="column">
          <div>
            <label for="taille">Taille:</label>
            <input type="number" id="taille" [(ngModel)]="sddiagnostic.Taille" name="taille">
          </div>
        </div>
        <div class="column">
          <div>
            <label for="hemoglobine">Hémoglobine:</label>
            <input type="number" id="hemoglobine" [(ngModel)]="sddiagnostic.Hemoglobine" name="hemoglobine" required>
          </div>
        </div>
        <div class="column">
          <div>
            <label for="reticulocyte">Réticulocyte:</label>
            <input type="number" id="reticulocyte" [(ngModel)]="sddiagnostic.Reticulocyte" name="reticulocyte" required>
          </div>
        </div>
      </div>

      <!-- Third Row -->
      <div class="row">
        <div class="column">
          <div>
            <label for="nbrGlobulesBlancs">Nombre de globules blancs:</label>
            <input type="number" id="nbrGlobulesBlancs" [(ngModel)]="sddiagnostic.NbrGlobulesBlancs" name="nbrGlobulesBlancs" required>
          </div>
        </div>
        <div class="column">
          <div>
            <label for="tauxPlaquette">Taux de plaquettes:</label>
            <input type="number" id="tauxPlaquette" [(ngModel)]="sddiagnostic.TauxPlaquette" name="tauxPlaquette" required>
          </div>
        </div>
        <div class="column">
          <div>
            <label for="ferritine">Ferritine:</label>
            <input type="number" id="ferritine" [(ngModel)]="sddiagnostic.Ferritine" name="ferritine" required>
          </div>
        </div>
      </div>

      <!-- Fourth Row -->
      <div class="row">
        <div class="column two-cols">
          <label for="anemie">Anémie:</label>
          <input type="checkbox" id="anemie" [(ngModel)]="sddiagnostic.Anemie" name="anemie">
        </div>
        <div class="column two-cols">
          <label for="splenomegalie">Splénomégalie:</label>
          <input type="checkbox" id="splenomegalie" [(ngModel)]="sddiagnostic.Splenomegalie" name="splenomegalie">
        </div>
      </div>

      <!-- Fifth Row -->
      <div class="row">
        <div class="column two-cols">
          <label for="ictere">Ictère:</label>
          <input type="checkbox" id="ictere" [(ngModel)]="sddiagnostic.Ictere" name="ictere">
        </div>
        <div class="column two-cols">
          <label for="splenomegalieCourant">Splénomégalie Courant:</label>
          <input type="checkbox" id="splenomegalieCourant" [(ngModel)]="sddiagnostic.SplenomegalieCourant" name="splenomegalieCourant">
        </div>
      </div>

      <!-- Sixth Row (Conditional Fields) -->
      <div class="row">
        <div class="column two-cols">
          <label for="complicationAigue">Complication Aigue:</label>
          <input type="checkbox" id="complicationAigue" [(ngModel)]="sddiagnostic.ComplicationAigue" name="complicationAigue" (change)="toggleComplicationAigue()">
        </div>
        <div class="column two-cols" *ngIf="sddiagnostic.ComplicationAigue">
          <label for="specificationCa">Specification CA:</label>
          <input type="text" id="specificationCa" [(ngModel)]="sddiagnostic.SpecificationCa" name="specificationCa">
        </div>
      </div>

      <!-- Seventh Row (Conditional Fields) -->
      <div class="row">
        <div class="column two-cols">
          <label for="enqueteFamiliale">Enquete Familiale:</label>
          <input type="checkbox" id="enqueteFamiliale" [(ngModel)]="sddiagnostic.EnqueteFamiliale" name="enqueteFamiliale" (change)="toggleEnqueteFamiliale()">
        </div>
        <div class="column two-cols" *ngIf="sddiagnostic.EnqueteFamiliale">
          <label for="specificationEf">Specification EF:</label>
          <input type="text" id="specificationEf" [(ngModel)]="sddiagnostic.SpecificationEf" name="specificationEf">
        </div>
      </div>

      <!-- Eighth Row (Conditional Fields) -->
      <div class="row">
        <div class="column two-cols">
          <label for="autreComplication">Autre Complication:</label>
          <input type="checkbox" id="autreComplication" [(ngModel)]="sddiagnostic.AutreComplication" name="autreComplication" (change)="toggleAutreComplication()">
        </div>
        <div class="column two-cols" *ngIf="sddiagnostic.AutreComplication">
          <label for="specificationAutre">Specification Autre:</label>
          <input type="text" id="specificationAutre" [(ngModel)]="sddiagnostic.SpecificationAutre" name="specificationAutre">
        </div>
      </div>

      <!-- Ninth Row (Conditional Fields) -->
      <div class="row">
        <div class="column two-cols">
          <label for="electrophoreseAvantPremiereTransfusion">Electrophorèse avant la première transfusion:</label>
          <input type="checkbox" id="electrophoreseAvantPremiereTransfusion" [(ngModel)]="sddiagnostic.ElectrophoreseAvantPremiereTransfusion" name="electrophoreseAvantPremiereTransfusion" (change)="toggleElectrophorese()">
        </div>
      </div>

      <!-- Tenth Row (Conditional Fields) -->
      <div class="row" *ngIf="sddiagnostic.ElectrophoreseAvantPremiereTransfusion">
        <div class="column">
          <label for="HbHbA">HbHbA:</label>
          <input type="number" id="HbHbA" [(ngModel)]="sddiagnostic.HbHbA" name="HbHbA">
        </div>
        <div class="column">
          <label for="HbA2">HbA2:</label>
          <input type="number" id="HbA2" [(ngModel)]="sddiagnostic.HbA2" name="HbA2">
        </div>
        <div class="column">
          <label for="HbF">HbF:</label>
          <input type="number" id="HbF" [(ngModel)]="sddiagnostic.HbF" name="HbF">
        </div>
        <div class="column">
          <label for="HbS">HbS:</label>
          <input type="number" id="HbS" [(ngModel)]="sddiagnostic.HbS" name="HbS">
        </div>
        <div class="column">
          <label for="autreHb">Autre Hb:</label>
          <input type="text" id="autreHb" [(ngModel)]="sddiagnostic.AutreHb" name="autreHb">
        </div>
      </div>

      <!-- Submit Row -->
      <div class="submit-row">
        <input type="submit" value="Submit">
      </div>

    </form>
  </div>

  <script>
    function toggleComplicationAigue() {
      const complicationAigueChecked = document.getElementById('complicationAigue').checked;
      document.getElementById('specificationCa').style.display = complicationAigueChecked ? 'block' : 'none';
    }

    function toggleEnqueteFamiliale() {
      const enqueteFamilialeChecked = document.getElementById('enqueteFamiliale').checked;
      document.getElementById('specificationEf').style.display = enqueteFamilialeChecked ? 'block' : 'none';
    }

    function toggleAutreComplication() {
      const autreComplicationChecked = document.getElementById('autreComplication').checked;
      document.getElementById('specificationAutre').style.display = autreComplicationChecked ? 'block' : 'none';
    }

    function toggleElectrophorese() {
      const electrophoreseChecked = document.getElementById('electrophoreseAvantPremiereTransfusion').checked;
      document.getElementById('HbHbA').style.display = electrophoreseChecked ? 'block' : 'none';
      document.getElementById('HbA2').style.display = electrophoreseChecked ? 'block' : 'none';
      document.getElementById('HbF').style.display = electrophoreseChecked ? 'block' : 'none';
      document.getElementById('HbS').style.display = electrophoreseChecked ? 'block' : 'none';
      document.getElementById('autreHb').style.display = electrophoreseChecked ? 'block' : 'none';
    }
  </script>
</body>
</html>
